import React, { useState } from 'react';
import './App.css';
import Game from './components/Game';

function App() {
  const boardSize = 100;
  return (
    <div className="App">
      <input onChange={(e) => setSize(e.current.value)} />
      <Game size={boardSize} />
      <Game>
        <Board>
          <Cell />
        </Board>
        <Dice />
        <Player />
      </Game>
    </div>
  );
}

export default App;
